import React from 'react';
import CreateUser from './components/CreateUser';
import UserList from './components/UserList';
import UpdateUser from './components/UpdateUser';

function App() {
  return (
    <div>
      <h1>User CRUD Application</h1>
      <CreateUser />
      <UserList />
      <UpdateUser />
    </div>
  );
}

export default App;
